import React, { useState, useEffect } from "react";
import { Navbar } from "../index";
import "./Pickup.css";

function Pickup() {
  const [formData, setFormData] = useState({
    parcel: "0",
    pickupDate: "",
    pickupTime: "0",
    pickupLocation: "",
    province: "0",
  });

  const [locations, setLocations] = useState([]); // State to store location data

  useEffect(() => {
    // Fetch data when the component mounts
    fetch("/pickup")
      .then((response) => {
        if (response.ok) {
          return response.json();
        }
        throw new Error("Failed to fetch data");
      })
      .then((data) => {
        // Assuming data is an array of location objects with id and name properties
        setLocations(data.provinces);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []); // Empty dependency array ensures this effect runs only once, on mount

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Perform your form submission logic here
    console.log(formData);
  };

  return (
    <div>
      <Navbar />
      <div className="Pickup-container" id="container">
        <div className="Pickup-form-container">
          <form onSubmit={handleSubmit}>
            <h1 className="header">Pickup request</h1>
            <span>select location and date for pickup service</span>
            <br />
            <br />

            {/* Parcel selection */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Select parcel</span>
              </label>
              <div className="enterdata">
                <select
                  name="parcel"
                  value={formData.parcel}
                  onChange={handleInputChange}
                >
                  {/* Populate options from state */}
                  {locations.map((location) => (
                    <option key={location.code} value={location.code}>
                      {location.code}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            <br />

            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup date</span>
              </label>
              <div class="enterdata">
                <input type="date" />
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup time</span>
              </label>
              <div class="enterdata">
                <select id="selector">
                  <option value="0">10:00 - 13:00</option>
                  <option value="1">13:00 - 15:00</option>
                  <option value="2">15:00 - 17:00</option>
                </select>
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup location detail</span>
              </label>
              <div class="enterdata">
                <input
                  type="Address details"
                  placeholder="Enter address details"
                />
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">
                  Provinces/District/Sub-district/zip code
                </span>
              </label>
              <div class="enterdata">
                <select id="selector">
                  <option value="0">BKK</option>
                  <option value="1">Samut prakarn</option>
                </select>
              </div>
            </div>
            <br />
            <button onClick={handleSubmit}>submit</button>
            <button type="submit">Submit</button>

            <button type="submit">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Pickup;
